import styled from "styled-components";

export const BarraNavegacaoStyle = styled.div`
color:white;
font-size:30px;
background-color: black;
height:70vh;
border: 1px solid grey;
text-align:center;
display:flex;
flex-direction: column;
padding-top:10px;
align-items: center;
row-gap:15px;

`

export const SelectStyle = styled.select`
background-color: gray;
padding: 1.5%;
border: solid 1px white;
border-radius: 10px;
`
